 <script language=Javascript>
 function sanitycheck(frm){
        var errmsg='';
        var txtfield=null;
        if(frm.employeeno.value==''){
                errmsg+='\n- Employee No.';
                if(txtfield==null){
                        if(frm.employeeno.value=='') txtfield=frm.employeeno;
                }
        }
        if(frm.lastname.value==''){
                errmsg+='\n- Last Name';
                if(txtfield==null){
                        txtfield=frm.lastname;
                }
        }
        if(frm.firstname.value==''){
                errmsg+='\n- First Name';
                if(txtfield==null){
                        txtfield=frm.firstname;
                }
        }
        if(frm.gender.value==''){
                errmsg+='\n- Gender';
                if(txtfield==null){
                        txtfield=frm.gender;
                }
        }
        if(errmsg!=''){
                alert('These fields cannot be left blank:' + errmsg);
                txtfield.focus();
                return false;
        }
 }
